// Teste simples do cadastro
const fetch = require('node-fetch');

async function testRegister() {
  console.log('üß™ Testando cadastro...\n');

  const testUser = {
    name: 'Usu√°rio Teste Frontend',
    email: 'teste-frontend@exemplo.com',
    password: '123456',
    age: 25,
    school: 'Escola Teste',
    class: 'Turma A'
  };

  try {
    console.log('üì° Enviando dados:', testUser);
    
    const response = await fetch('http://localhost:3001/api/auth/register', {
      method: 'POST',
      headers: {
        'Content-Type': 'application/json',
      },
      body: JSON.stringify(testUser),
    });

    console.log('üì° Status da resposta:', response.status);
    console.log('üì° Headers:', response.headers.raw());

    const data = await response.json();
    console.log('üì° Dados da resposta:', data);

    if (response.ok && data.success) {
      console.log('‚úÖ Cadastro bem-sucedido!');
      console.log('üë§ Usu√°rio:', data.data.user);
      console.log('üîë Token:', data.data.token.substring(0, 20) + '...');
    } else {
      console.log('‚ùå Erro no cadastro:', data.message);
    }

  } catch (error) {
    console.error('‚ùå Erro na requisi√ß√£o:', error.message);
  }
}

testRegister();
